import data from "./data";
const App = () => {
  return (
    <div>
      <header>
        <img
          styled={{ width: "131px", heigth: "59px" }}
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTgIpKjH_MJ2AzYNL1BErveqhBayVVYEoC9eZP6nZoiHieuroUf4DKzBIk2Z-shWYvmVok&usqp=CAU"
        />
        <></>
      </header>
    </div>
  );
};
export default App;
